ay Manali.</p></div></div></div></div></div></div></section></div></div><div id="where-to-eat" role="region" aria-label="Where to eat" tabindex="-1"><span id="navbar-item-where-to-eat" class="vlX0-section-scroll-position" style="top:-100px"></span><div class="kml-layout edges-m mobile-edges c31EJ"><span id="-section" style="top:0" class="Vdvb-section-scroll-position"></span><section id="" class="Vdvb Vdvb-mod-size-standard Vdvb-mod-color-default"><div class="Vdvb-header-container" data-testid="header"><h2 class="Vdvb-title">Where to Eat in Manali</h2></div><div class="KMce-row kml-row"><div class="KMce-article kml-col-12-12 kml-col-7-12-l"><div><p class="PylL-text">If you've worked up an appetite, why not dig into a South Indian fare when in the north? Check out Madras mess, a mess-style eatery offering unlimited meals for ₹80.</p></div></div><div class="kml-col-12-12 kml-col-4-12-l"></div></div></section></div></div><div id="when-to-visit" role="region" aria-label="When to visit" tabindex="-1"><span id="navbar-item-when-to-visit" class="vlX0-section-scroll-position" style="top:-100px"></span><div class="kml-layout edges-m mobile-edges c31EJ"><span id="-section" style="top:0" class="Vdvb-section-scroll-position"></span><section id="" class="Vdvb Vdvb-mod-size-standard Vdvb-mod-color-default"><div class="Vdvb-header-container" data-testid="header"><h2 class="Vdvb-title">When to visit Manali</h2></div><div class="kml-col-hidden kml-col-l"><div class="kml-row"><div class="kml-col-9-12"><div style="height:444px"></div></div><div class="kml-col-3-12"><div class="cqWh-title">Manali in September</div><div class="cqWh-subtitle">Estimated hotel price</div><div class="cqWh-price">₹ 708</div><div><div class="cqWh-details"></div><div class="cqWh-details"></div><div class="cqWh-details">1 night at 3-star hotel</div></div></div></div></div><div class="kml-col-hidden-l"><div class="cqWh-mobile-header"><div class="cqWh-title">Manali in September</div><div class="cqWh-subtitle">Estimated hotel price</div></div><div class="cqWh-mobile-container"><div class="cqWh-price cqWh-mobile-item">₹ 708</div><div class="cqWh-mobile-item"><div class="cqWh-details"></div><div class="cqWh-details"></div><div class="cqWh-details">1 night at 3-star hotel</div></div></div><div style="height:444px"></div></div><div class="wEoM-article"><p>Manali is cold in the winters while summers are warmer but still retain a touch of coolness. Temperatures are typical of the north: lows of 39°F and highs of 68°F.</p></div><div class="kml-col-hidden kml-col-l"><div class="kml-row"><div class="kml-col-9-12 "><div style="height:444px"></div><div class="EsRX-weatherbase">Data provided by<!-- --> <a href="#" target="_blank" class="ZT1E-anchor-reset"><img src="/res/images/horizon/hotels/cityguides/weatherbase-logo.png" alt="weatherbase"/></a></div></div><div class="kml-col-3-12"><div class="EsRX-temperature-header">Temperatures</div><div class="EsRX-temperature-radiuses"><div id="" class="YBNk-radios YBNk-pres-layout-column YBNk-mod-align-center YBNk-mod-spacing-xsmall" role="radiogroup"><label for="0" class="sSPb sSPb-mod-label-placement-end sSPb-theme-default sSPb-mod-size-small"><span class="sSPb-radio"><input id="0" tabindex="0" aria-disabled="false" aria-checked="false" class="sSPb-input" type="radio" name="" aria-hidden="false" title="Highs" index="0" value="highestTemperatures"/></span><span class="sSPb-label sSPb-mod-spacing-small">Highs</span></label><label for="1" class="sSPb sSPb-mod-checked sSPb-mod-label-placement-end sSPb-theme-default sSPb-mod-size-small"><span class="sSPb-radio"><input id="1" tabindex="0" aria-disabled="false" aria-checked="true" class="sSPb-input" type="radio" name="" aria-hidden="false" title="Average" index="1" checked="" value="averageTemperatures"/></span><span class="sSPb-label sSPb-mod-spacing-small">Average</span></label><label for="2" class="sSPb sSPb-mod-label-placement-end sSPb-theme-default sSPb-mod-size-small"><span class="sSPb-radio"><i